import React from 'react'
import datosHotel from '../datos_tarjeta_hoteles.json'
import Carrusel from '../carrusel_de_fotos'

import Plantilla from '../hotel'

class Princess extends React.Component

{

    render() {
        return (
            <Plantilla datosCarrusel={Carrusel}/>
        )
        
    }

}

export default Princess
